.s-tf button,
.s-btn {
  display: inline-block;
  text-decoration: none;
  padding: 0.8em 1.4em;
  font-size: 16px;
  padding: 0.8em 1.4em;
}


.s-tf button.smaller,
.s-btn--smaller {
  padding: 0.48em 0.84em;
  font-size: 9.6px;
}


.s-tf button.small,
.s-btn--small {
  padding: 0.64em 1.12em;
  font-size: 12.8px;
}


.s-tf button.default,
.s-btn {
  padding: 0.8em 1.4em;
}


.s-tf button.medium,
.s-btn--medium {
  padding: 0.88em 1.54em;
  font-size: 17.6px;
}


.s-tf button.big,
.s-btn--big {
  padding: 0.96em 1.68em;
  font-size: 19.2px;
}


.s-tf button.bigger,
.s-btn--bigger {
  padding: 1.04em 1.82em;
  font-size: 20.8px;
}


.s-tf button,
.s-btn {
  border-radius: 0.2em;
  color: white;
  transition: all 0.1s ease-in-out 0s;
  background-color: #f2bc2b;
}
.s-tf button:hover,
.s-btn:hover {
  background-color: #f2bc2b;
}



.s-tf button.secondary,
.s-btn.s-btn--secondary {
  background-color: #6d858f;
}
.s-tf button.secondary:hover,
.s-btn.s-btn--secondary:hover {
  background-color: #6d858f;
}


